import { StyleSheet, Text, TouchableHighlight, View } from 'react-native';

import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

const Stack = createNativeStackNavigator();

/**
 * Component used to redirect user in other screen
 * @param {String} name Name of the menu
 * @param {String} route Route to redirect on click
 * @returns 
 */
function HomeMenuButton({ navigation, name, route }) {
    return (
        <TouchableHighlight style={styles.menuButton} onPress={() => {
                navigation.navigate(route)
                console.log("sécho la vie");
        }}>
            <Text>{name}</Text>
        </TouchableHighlight>
    );
}

function HomeScreen({navigation}) {
    return (
        <View style={styles.container}>
            <Text style={styles.home_title}>Welcome !</Text>
            <View style={styles.home_menu}>
                <HomeMenuButton navigation={navigation} name="menu a" route="home"></HomeMenuButton>
                <HomeMenuButton navigation={navigation} name="menu b" route="home"></HomeMenuButton>
                <HomeMenuButton navigation={navigation} name="menu c" route="home"></HomeMenuButton>
                <HomeMenuButton navigation={navigation} name="menu d" route="home"></HomeMenuButton>
                <HomeMenuButton navigation={navigation} name="menu e" route="home"></HomeMenuButton>
            </View>
        </View>
    );
}


export default function App() {
  return (
      <NavigationContainer>
          <Stack.Navigator screenOptions={{
              headerShown: false
            }}>
              <Stack.Screen name="Home" component={HomeScreen} />
          </Stack.Navigator>
      </NavigationContainer>
  );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: 'column',
        padding: 20
    },
    home_title: {
        textAlign: 'center',
        fontSize: 20,
        fontWeight: 'bold',
        flex: 1
    },
    home_menu: {
        flex: 5,
        flexWrap: 'wrap',
        flexDirection: "row",
        justifyContent: 'center'
    },
    menuButton: {
        justifyContent: 'center',
        textAlign: 'center',
        marginHorizontal: "10%",
        width: "30%",
        height: "20%",
        borderRadius: 20,
        alignSelf: "flex-start",
        backgroundColor: "#8AD1DB",
    }
});
